  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>  
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Agendamento Pet</title>
  <link href="https://fonts.googleapis.com/css2?family=Inter+Tight:ital,wght@0,100..900;1,100..900&family=Roboto+Flex:opsz,wght@8..144,100..1000&family=Roboto+Mono:ital,wght@0,100..700;1,100..700&family=Sora:wght@100..800&display=swap" rel="stylesheet">
  <link href="https://fonts.googleapis.com/css2?family=Inter+Tight:ital,wght@0,100..900;1,100..900&family=Inter:ital,opsz,wght@0,14..32,100..900;1,14..32,100..900&family=Roboto+Flex:opsz,wght@8..144,100..1000&family=Roboto+Mono:ital,wght@0,100..700;1,100..700&family=Sora:wght@100..800&display=swap" rel="stylesheet">

<script defer src="main.js"></script></head>
<body>
  <a href="/" class="logo"><img src="./src/assets/logo.svg" alt="Mundo Pet"></a>

  <div class="btn-container">
    <button class="btn-primary" id="btn-modal">NOVO AGENDAMENTO</button>
  </div>
  
  <div class="container">
    <header class="header">
      <hgroup>
        <h1 class="title">Sua agenda</h1>
        <h2 class="description">Aqui você pode ver todos os clientes e serviços agendados para hoje.</h2>
      </hgroup>
      <fieldset>
        <img src="./src/assets/calendar.svg" alt="Calendário" />
        <input type="date" title="Data" id="day-list" />
      </fieldset>
    </header>
 
    <main>
      <div class="card">
        <header>
          <div class="period">
            <img src="./src/assets/morning.svg" alt="">
            Manhã
          </div>
          <div class="range-hour">09h-12h</div>
        </header>
        <div class="data" id="morning">
          <!-- <div class="line">
            <div class="col-hour">09:00</div>
            <div class="col-who">Thor / <small>Fernanda Costa</small></div>
            <div class="col-service">Vacinação</div>
            <div class="col-control"><a href="#">Remover agendamento</a></div>
          </div>-->
        </div>
      </div>
      <div class="card">
        <header>
          <div class="period">
            <img src="./src/assets/afternoon.svg" alt="">              
            Tarde
          </div>
          <div class="range-hour">13h-18h</div>
        </header>
        <div class="data" id="afternoon"></div>
      </div>
      <div class="card">
        <header>
          <div class="period">
            <img src="./src/assets/night.svg" alt="">              
            Noite
          </div>
          <div class="range-hour">19h-21h</div>
        </header>
        <div class="data" id="evening"></div>
      </div>
    </main>

    <div class="modal">
      <a href="#" class="close" id="btn-close-modal"><img src="./src/assets/close.svg" alt="Fechar"></a>
      <h3 class="title">Agende um atendimento</h3>
      <p class="description">Preencha os dados do cliente para realizar o agendamento:</p>

      <form action="" id="form-schedule">
        <input type="hidden" id="id-field" value="0" />
        
        <div class="line">
          <div class="col">
            <label for="tutor-field">Nome do tutor</label>
            <fieldset>
              <img src="./src/assets/tutor.svg" alt="" />            
              <input type="text" class="" id="tutor-field" required />
            </fieldset>
          </div>
        </div>

        <div class="line">
          <div class="col">
            <label for="pet-field">Nome do pet</label>
            <fieldset>
              <img src="./src/assets/pet.svg" alt="" />            
              <input type="text" class="" id="pet-field" required />
            </fieldset>
          </div>
        </div>

        <div class="line">
          <div class="col">
            <label for="phone-field">Telefone</label>
            <fieldset>
              <img src="./src/assets/phone.svg" alt="" />            
              <input type="text" class="mask-phone" id="phone-field" placeholder="(00) 0 0000-0000" required maxlength="15" />
            </fieldset>
          </div>
        </div>
        
        <div class="line">
          <div class="col">
            <label for="service-field">Descrição do serviço</label>
            <fieldset>
              <textarea name="service" id="service-field" required></textarea>
            </fieldset>
          </div>
        </div>

        <div class="line two-column">
          <div class="col">
            <label for="date-field">Data</label>
            <fieldset>
              <img src="./src/assets/calendar.svg" alt="" />            
              <input type="date" class="" id="date-field" required />
            </fieldset>
          </div>
          <div class="col">
            <label for="hour-field">Hora</label>
            <fieldset>
              <img src="./src/assets/clock.svg" alt="" />
              <select id="hour-field" required>
                <option value="-1">horários</option>
              </select>
            </fieldset>
          </div>
        </div>

        <div class="buttons">
          <button type="submit" class="btn-primary" id="btn-form">Agendar</button>
        </div>
      </form>
    </div>

  </div>
</body>
</html>
